input = ""
test_input = "dabAcCaCBAcCcaDA"

class String
  def is_upper?
    self == self.upcase
  end

  def is_lower?
    self == self.downcase
  end
end

def reacts?(c1, c2)
  c1.capitalize == c2.capitalize && c1.is_upper? != c2.is_upper?
end

def remove_one(input)
  removed = false
  for i in 0..input.length-2 do
    if reacts?(input[i], input[i+1]) then
      input[i] = "_"
      input[i+1] = "_"
      removed = true
    end
  end

  return removed, input.delete("_")
end

def reduce(input)
  changed = true
  while changed do
    changed, input = remove_one(input)
  end
  input
end

puts "Test case works: #{reduce(test_input) == "dabCBAcaDA"}"
puts "Reduced length: #{reduce(input).length}"

for letter in 'a'..'z' do
  tmp_in = input.delete(letter).delete(letter.upcase)
  res = reduce(tmp_in)
  puts "#{res.length}: #{letter}"
end
